import React from 'react';

const tags = [{
    label: "Saddle Bags", color: "#000"
},
{
    label: "Tote Bags", color: "primary"
},
{
    label: "Messenger Bags", color: "primary"
}]

export default function Tags() {
    return (
        <div>

            {
                tags.map((tag, index) => {
                    return (
                        <div key={index} className="tag_btn_group">
                            <button className='tag_btn'>{tag.label}</button>
                        </div>
                    )
                })
            }
        </div>


    )
}
